import React, { useEffect, useState ,useContext} from 'react'
import apiServer from '../services/apiService'
import Card from '../Card'
import {userContext} from '../../App'


export default function Users(props) {
    const {asd,setAsd,myFunc} = useContext(userContext);

    const [object, setObject] = useState(null);
    useEffect(() => {
        apiServer.then(res => {setObject(res) })
    }, [])


    return (
        <div className="row d-flex justify-content-center">
            {props.isLogged? 
            object && object.map((item, index) => <Card key={index} name={item.name.first +' ' + item.name.last} age = {item.age} email = {item.email} picture = {item.picture} obj ={item} getUser={props.getUser}/>)
            : <h3>Log in to see users!</h3>}
        </div>
    )
}
